import styled from "styled-components";

const Container = styled.div`
    height 10vh;
    width 20vw;
    display: flex;
    align-items: center;
    justify-content: center;
`;

const Oval = styled.div`
    height:200px;
    width: 210px;
    border-radius: 50%;
    background-color: #ede3df;
    position: relative;
`;

const TextContainer = styled.div`
    display:flex;
    position: absolute;
    align-items: center;
`;

const Text = styled.div`
    font-family: 'Oooh Baby', cursive;
    font-size: 100px;
`;

const SubText = styled.div`
    font-size: 20px;
    padding-top: 120px;
    padding-right: 400px;
`;

const Image = styled.img`
    height: 100px;
    z-index: -1;
`;
                                                
const Logo = () => {
    return(
    <Container>
        <Oval/>
        <TextContainer>            
            <Text>CULT</Text>
            <Image src={require("../images/letterR.png")}/>
        </TextContainer>
        <SubText>M A G A Z I N E</SubText>
    </Container>
    );   
}

export default Logo;
